import {
    connect
} from "react-redux";

const BASE_URL = "https://5e9935925eabe7001681c856.mockapi.io/api/v1/catalog/";

export const getCatalog = () => {

    var catalog = [];


    return catalog;
}

const connection = () => {
    async function connect() {
        let response = await fetch(BASE_URL);
        let data = await response.json();

        return data;
    }

    connect().then(data => [...data]);
}
